import { useState } from "react";
import HomePage from "../../pages/HomePage/HomePage";
import ThemeSwitcher from "../../pages/ThemeSwitcher/Themeswitcher";
import { GlobalThemes, themeManager } from "../../ThemeManager";
import NavBar from "../NavBar/NavBar";
import "./RenderComponent.scss";
const RenderComponent = () => {
  const [theme, setTheme] = useState(GlobalThemes.Enterprise);
  return (
    <div className={"renderContainer " + GlobalThemes[theme]}>
      <div className="leftContainer">
        <NavBar theme={theme} setTheme={setTheme} isVertical={true} />
      </div>
      <div className="rightContainer">
        <ThemeSwitcher theme={theme} setTheme={setTheme} />
      </div>
    </div>
  );
};
export default RenderComponent;
